INSERT INTO `test` (`ID`, `pregunta`, `respuestaA`, `respuestaB`, `respuestaC`, `correcta`) VALUES
(1, 'Te encuentras caminando hacia tu casa, decides tomar un pequeño atajo que cruza por un callejón. Justo al girar la esquina das de bruces con cuatro personas que \natracan a una quinta, ¿cómo actuarías?', 'A) Paso tranquilamente, si no les molesto no me harán nada.', 'B) Intento defender a la víctima y me enfrento a ellos.', 'C) Si no me han visto, retrocedería y llamaría a la policía o me iría de allí.', 'C'),
(2, 'Me encuentro roleando dentro del servidor y por motivos OOC debo quedarme AFK durante 20 minutos.', 'A) Aviso a las personas con las que estaba roleando que debo irme y acordamos seguir el rol en 20 minutos.', 'B) Me quedo AFK en un sitio escondido porque puedo estarlo todo el tiempo que necesite.', 'C) Digo que tengo que irme y me desconecto, diciendo que pueden rolear conmigo como si fuese un NPC.', 'A'),
(3, 'Me enfrento a otro jugador en un pelea cuerpo a cuerpo, el otro usuario saca una pistola y, tras varios disparos, me mata. ¿Es correcto?', 'A) Sí, su personaje ha sido más rápido que el mio, ha sacado su arma y me ha matado.', 'B) No, porque mi personaje nunca se lo habría permitido, así que ha cometido PowerGaming.', 'C) Si hubiese sido delante de más gente en un sitio público no estaría correcto.', 'A'),
(4, 'Veo de forma OOC que un amigo está jugando en el servidor porque su personaje que es el que usaba en otro servidor hace tiempo.', 'A) Voy a buscarlo, cuando lo encuentro lo saludo por ''/B'' y nos contamos como nos va.', 'B) Sigo roleando con naturalidad, si me encuentro con su personaje podría acercarme a él e iniciar una conversación IC.', 'C) Lo busco en Skype y acordamos vernos en un lugar IC roleando que nos hemos encontrado por casualidad y que ya nos conocemos.', 'B'),
(5, '¿En qué se pueden diferenciar los tipos de PlayerKill?', 'A) En uno se pierde la memoria y en otro la cuenta del personaje queda bloqueada.', 'B) En uno se pierde un fragmento concreto de la memoria y en otro su totalidad.', 'C) En ambos se pierde toda la memoria, pero en uno se puede mantener las cosas de la cuenta (casas, dinero, nivel, etcétera) y en el otro no.', 'B'),
(6, '¿Cuál de estas acciones no presenta una infracción?', 'A) Veo que un compañero acaba de conectarse, le pregunto por TS su posición y de camino caigo de un puente de más de quince metros, roleo las heridas y los tratamientos además de la actuación del equipo médico.', 'B) Observo que en una zona apartada dos facciones rivales están disparándose entre sí, yo me quedo escondido y apartado para no ser visto o dañado, tras la huida de los sujetos me acerco a las bajas para recoger rápidamente sus pertenencias.', 'C) Durante un rol de atraco al banco soy rodeado por el LSPD. Aprovechando que los agentes no están apuntando cuando escriben un comando, salgo corriendo lo más rápido que puedo a mi coche y me voy de allí roleando las consecuencias IC.', 'B'),
(7, '¿En cuál de estos casos se da un claro PG?', 'A) Voy andando por la calle y observo que un conocido pasa con el coche sin percatarse de mí, intento alcanzarle corriendo mientras salto.', 'B) Un usuario me atraca a cara descubierta en una zona apartada, tras el robo decido ir a denunciarle al LSPD diciendo el nombre completo del atracador.', 'C) En una pelea soy herido varias veces con un arma blanca, quedándome poca vida, tras los altercados me levanto y corro para irme de la escena.', 'C'),
(8, 'Has de llegar a un punto del mapa y no tienes vehículo para poder llegar a este. ¿Cual es la opción correcta?', 'A) Voy corriendo y atajo trepando por los edificios.', 'B) Llamo a un policía con el que me llevo bien IC para que me lleve.', 'C) Voy andando o corriendo roleando el cansancio, o llamo a un taxi.', 'C'),
(9, '¿Cuál de estas acciones por /me está cometiendo una infracción?', 'A) /me lleva su mano a la chaqueta y tras abrirla extrae un boligrafo.', 'B) /me le pega una patada al sujeto en el pecho y lo tira al suelo', 'C) /me estira sus brazos y toma impulso para agarrarse a un saliente.', 'B'),
(10, '¿Cuál es el mejor método para enviar un reporte de rol?', 'A) Mandando un mensaje privado a un administrador.', 'B) Con el comando ''/Reportar''.', 'C) Enviando un reporte al foro.', 'C'),
(11, '¿En qué momento no se habría usado bien el /Do?', 'A) /do Se aprecia un olor desagradable que proviene del contenedor de basura.', 'B) /do Pensamiento de Michael Crow: Qué sed tengo...', 'C) /do Se puede apreciar que en la zona vive gente no muy amigable.', 'B'),
(12, '¿Cuál es el significado de CK?', 'A) Muerte total de un personaje.', 'B) Atropellar a alguien hasta que muere.', 'C) Ambas son correctas.', 'C'),
(13, '¿Podría utilizar mi vehículo de trabajo para asuntos personales?', 'A) Solo si roleo que me arriesgo a que me despidan.', 'B) No, está prohibido.', 'C) Solo si es una emergencia.', 'B'),
(14, '¿Si me dice un amigo por skype que le recoja en algún sitio IC cómo actuaria?', 'A) Le diría que me llame IC ya que si no se consideraría MG.', 'B) Le diría que la próxima vez me lo diga por el juego y voy a buscarlo.', 'C) Voy al sitio que me dijo roleando que coincidimos por casualidad.', 'A'),
(15, '¿Cuál es el significado de MG?', 'A) Confundir canales IC con canales OOC.', 'B) Usar información OOC para beneficio IC.', 'C) Las respuestas A y B son correctas.', 'B'),
(16, '¿Cuál de estas acciones no sería considerada MG?', 'A) Un amigo me avisa por Skype que le están atracando en Willowfield y llamo a la policía IC contándolo.', 'B) En el apartado del foro ''''Anuncios'''' encuentro un vehiculo bien de precio, no me lo pienso dos veces y llamo con mi teléfono móvil IC.', 'C) Ninguna de las respuestas es correcta.', 'B'),
(17, 'Me surge una duda y decido preguntar con el comando adecuado. Los administradores tardan en contestarme, ¿qué hago?', 'A) Le envío un mensaje privado a un administrador, esto realmente no incumple las normas.', 'B) Vuelvo a mandar la pregunta, igual se les ha olvidado responder.', 'C) Sigo esperando a que respondan.', 'C'),
(18, 'No pertenezco a ninguna facción pero necesito un arma, ¿cuál es el método correcto para conseguirla?', 'A) Hago un anuncio camuflado para llamar la atención de posibles vendedores de armas.', 'B) Intento robársela a un policía, dentro de lo que cabe no sería PG.', 'C) Intento ganar contactos que puedan hacerme ganar una.', 'C'),
(19, 'Voy por el medio de la calle conduciendo temerariamente y atropello a un usuario que justo cruzaba la calle. ¿Cómo debo actuar?', 'A) Me doy a la fuga porque no quiero que me metan un multón.', 'B) Me paro y atiendo a la víctima.', 'C) Ambas son correctas.', 'C'),
(20, 'Un usuario te dice utiliza un CLEO (mod de juego) que le permite ver el radar del mapa de forma cuadrada. ¿Debería ser reportado?', 'A) No, esa modificación no le da ventaja sobre el resto de jugadores.', 'B) Sí, está totalmente prohibido el uso de mods en el juego.', 'C) Da igual, si no me afecta no tengo por qué reportarle.', 'A'),
(21, 'Debido al exceso de velocidad te chocas contra un muro pero no ves a nadie cerca para rolear con él. ¿Qué harías?', 'A) No hay nadie cerca, hago como que no ha pasado nada y sigo mi camino.', 'B) Roleo por /do el ambiente y que alguien me vio y llamó a los servicios de emergencia para socorrerme.', 'C) Ambas son correctas.', 'B'),
(22, 'Por amplios motivos IC quieres asesinar a una persona, elaboras un plan y obtienes las armas necesarias para liquidarle; le ves en una zona publica y decides ir a matarle ¿Qué harías al matarlo?', 'A) Termino de dispararle y me doy a la fuga, luego roleo ser un NPC testigo y aviso a la policía, así roleo asumir las consecuencias IC.', 'B) Termino de dispararle y me doy a la fuga, él mismo puede rolear ser un NPC testigo y avisar a la policía.', 'C) No haría eso, ya que al ser una zona pública sería totalmente PG.', 'A'),
(23, 'En mitad de un rol, un PJ que es miembro del staff ha utilizado sus comandos de administrador para congelarte y rolear atracarte. ¿Qué deberías hacer?', 'A) Aviso a un administrador de mayor nivel para quejarme.', 'B) Lo reporto como haría con otro usuario normal en el apartado de Reportes.', 'C) Envío una queja al apartado de Quejas a la administración.', 'C'),
(24, '¿Qué de lo siguiente está bien hacer si roleas ser una persona agresiva debido a problemas mentales?', 'A) Buscar pelea con alguien que lleva un buen rato mirándote.', 'B) Pegar a los coches que veas con gente dentro para romperles las puertas y rolear escupirles.', 'C) Atacar rápidamente a un grupo de personas, esconderte al momento para luego volver a atacarles y repetir la estrategia.', 'A');
